
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='914' height='609'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #layer1
	
// #rect115
	ctx.beginPath();
	ctx.lineWidth = 0.672042;
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.rect(15.478125, 10.715625, 802.481260, 581.024960);
	ctx.stroke();
	
// #rect849
	ctx.beginPath();
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.lineWidth = 0.672042;
	ctx.rect(823.912480, 11.906250, 79.771873, 579.834350);
	ctx.stroke();
	
// #text1637
	ctx.save();
	ctx.transform(0.000000, -0.264583, 0.264583, 0.000000, 609.020000, 1001.510000);
	ctx.fillStyle = 'rgb(0, 0, 0)';
	ctx.lineWidth = 0.762000;
	ctx.font = "normal normal 66.6667px Arial";
	ctx.restore();

    </script>
</body>
</html>
